TR.TD:
LEO - Earth Observation.
The following are the Ground-to-Space / Space-to-ground links:
* Uplink: S band: Telecommand;
* Downlink: S band: Telemetry;
* Downlink: Ka band: Mission data;
* Downlink: X band: Direct Data Broadcast;

